import { useState } from "react";

const Button = function () {
  return <button>+</button>;
};

const Counter = function () {
  const [count, setCount] = useState(0);
  return <div>{count}</div>;
};

function App() {
  return (
    <div>
      <Button />
      <Counter />
    </div>
  );
}

export default App;
